(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[55996],{645314:function(e,t,o){"use strict";o.r(t),o.d(t,{default:function(){return h}});var a={};o.r(a),o.d(a,{demoComponents:function(){return l},demos:function(){return r},docs:function(){return s},srcComponents:function(){return c}});var n=o(295649);o(827378);var i=o(669595),s={en:{description:"Material UI is a library of React UI components that implements Google's Material Design.",location:"/docs/data/material/getting-started/overview/overview.md",rendered:['<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n<symbol id="comment-link-icon" viewBox="0 0 24 24">\n  <path d="M20 2H4c-1.1 0-1.99.9-1.99 2L2 22l4-4h14c1.1 0 2-.9 2-2V4c0-1.1-.9-2-2-2zM6 14v-2.47l6.88-6.88c.2-.2.51-.2.71 0l1.77 1.77c.2.2.2.51 0 .71L8.47 14H6zm12 0h-7.5l2-2H18v2z" />\n</symbol>\n</svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n  <symbol id="anchor-link-icon" viewBox="0 0 16 16">\n    <path d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z" />\n  </symbol>\n</svg>','<h1>Material UI - Overview</h1><p class="description">Material UI is a library of React UI components that implements Google\'s Material Design.</p>\n\n<h2 id="introduction">Introduction<a aria-labelledby="introduction" class="anchor-link" href="#introduction" tabindex="-1"><svg><use xlink:href="#anchor-link-icon" /></svg></a><button title="Post a comment" class="comment-link" data-feedback-hash="introduction"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>Material UI is an open-source React component library that implements Google&#39;s <a href="https://m2.material.io/" target="_blank" rel="noopener nofollow">Material Design</a>.</p>\n<p>It includes a comprehensive collection of prebuilt components that are ready for use in production right out of the box.</p>\n<p>Material UI is beautiful by design and features a suite of customization options that make it easy to implement your own custom design system on top of our components.</p>\n<aside class="MuiCallout-root MuiCallout-info"><p>Material UI v5 supports Material Design v2.\nAdoption of v3 is tentatively planned for Material UI v6—see <a href="https://mui.com/versions/#release-schedule">the release schedule</a>.\nYou can follow <a href="https://github.com/mui/material-ui/issues/29345">this GitHub issue</a> for future updates.</p>\n\n</aside><h2 id="advantages-of-material-ui">Advantages of Material UI<a aria-labelledby="advantages-of-material-ui" class="anchor-link" href="#advantages-of-material-ui" tabindex="-1"><svg><use xlink:href="#anchor-link-icon" /></svg></a><button title="Post a comment" class="comment-link" data-feedback-hash="advantages-of-material-ui"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><ul>\n<li><strong>Ship faster:</strong> Over 2,500 open-source <a href="https://github.com/mui/material-ui/graphs/contributors">contributors</a> have poured countless hours into these components.\nFocus on your core business logic instead of reinventing the wheel—we&#39;ve got your UI covered.</li>\n<li><strong>Beautiful by default:</strong> we&#39;re meticulous about our implementation of <a href="https://m2.material.io/" target="_blank" rel="noopener nofollow">Material Design</a>, ensuring that every Material UI component meets the highest standards of form and function,\nbut diverge from the official spec where necessary to provide multiple great options.</li>\n<li><strong>Customizability:</strong> the library includes an extensive set of intuitive customizability features. <a href="https://mui.com/store/">The templates</a> in our store demonstrate how far you can go with customization.</li>\n<li><strong>Cross-team collaboration:</strong> Material UI&#39;s intuitive developer experience reduces the barrier to entry for back-end developers and less technical designers, empowering teams to collaborate more effectively.\nThe <a href="https://mui.com/design-kits/">design kits</a> streamline your workflow and boost consistency between designers and developers.</li>\n<li><strong>Trusted by thousands of organizations:</strong> Material UI has the largest UI community in the React ecosystem.\nIt&#39;s almost as old as React itself—its history stretches back to 2014—and we&#39;re in this for the long haul.\nYou can count on the community&#39;s support for years to come (e.g. <a href="https://insights.stackoverflow.com/trends?tags=material-ui">Stack Overflow</a>).</li>\n</ul>\n<h2 id="material-ui-vs-mui-base">Material UI vs. MUI Base<a aria-labelledby="material-ui-vs-mui-base" class="anchor-link" href="#material-ui-vs-mui-base" tabindex="-1"><svg><use xlink:href="#anchor-link-icon" /></svg></a><button title="Post a comment" class="comment-link" data-feedback-hash="material-ui-vs-mui-base"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>Material UI and <a href="/base/getting-started/overview/">MUI Base</a> feature many of the same UI components, but MUI Base comes without any default styles or styling solutions.</p>\n<p>Material UI is <em>comprehensive</em> in that it comes packaged with default styles, and is optimized to work with <a href="https://emotion.sh/">Emotion</a> (or <a href="https://styled-components.com/">styled-components</a>).</p>\n<p>MUI Base, by contrast, could be considered the &quot;skeletal&quot; or &quot;headless&quot; counterpart to Material UI—in fact, Material UI v6 will use MUI Base components and hooks for its foundational structure.</p>\n'],toc:[{text:"Introduction",level:2,hash:"introduction",children:[]},{text:"Advantages of Material UI",level:2,hash:"advantages-of-material-ui",children:[]},{text:"Material UI vs. MUI Base",level:2,hash:"material-ui-vs-mui-base",children:[]}],title:"Overview",headers:{title:"Overview",components:[],hooks:[]}}},r={};r.scope={process:{},import:{}};var l={},c={},u=o(824246);function h(){return(0,u.jsx)(i.Z,(0,n.Z)({},a))}},154300:function(e,t,o){(window.__NEXT_P=window.__NEXT_P||[]).push(["/material-ui/getting-started/overview",function(){return o(645314)}])}},function(e){e.O(0,[75760,36634,39152,35408,85992,56063,76957,41253,46888,21829,81125,68256,96387,46324,70116,73793,16402,86277,49983,18956,58156,76822,78723,69595,49774,92888,40179],function(){return e(e.s=154300)}),_N_E=e.O()}]);